--Members
-- Xóa dữ liệu cũ
DELETE FROM Members;
DBCC CHECKIDENT ('Members', RESEED, 0);

-- Biến khai báo
DECLARE @OwnerId INT = 1;
DECLARE @CategoryId INT;
DECLARE @i INT;
DECLARE @UserId INT;
DECLARE @RolePermissionId INT;
DECLARE @InvitedBy INT;

-- Sinh dữ liệu
WHILE @OwnerId <= 50
BEGIN
    SET @CategoryId = 1;

    WHILE @CategoryId <= 3
    BEGIN
        SET @i = 1;

        WHILE @i <= 4
        BEGIN
            -- UserId, RolePermissionId, InvitedBy ngẫu nhiên
            SET @UserId = FLOOR(RAND(CHECKSUM(NEWID())) * 50) + 1;
            SET @RolePermissionId = FLOOR(RAND(CHECKSUM(NEWID())) * 3) + 1;
            SET @InvitedBy = FLOOR(RAND(CHECKSUM(NEWID())) * 50) + 1;

            -- Insert dữ liệu
            INSERT INTO Members (
                UserId,
                RolePermissonId,
                CategoryId,
                OwnerId,
                InvitedBy,
                JoinedAt,
                MemberStatus
            ) 
            VALUES (
                @UserId,
                @RolePermissionId,
                @CategoryId,
                @OwnerId,
                @InvitedBy,
                GETDATE(),
                'ACTIVE'
            );

            SET @i = @i + 1;
        END

        SET @CategoryId = @CategoryId + 1;
    END

    SET @OwnerId = @OwnerId + 1;
END

